import {StyleSheet} from 'react-native'

export const styles = StyleSheet.create({
    headerContainer: {
      flex: 1,
      flexDirection: 'row',
      justifyContent: 'space-between',
    },
    headerLightGray: {
      backgroundColor: '#bcc2b0',
    },
    headerDarkGray: {
      backgroundColor: '#797d70',
    },

    headerCell: {
      padding: 12,
    },
    contentCell: {
      paddingVertical: 16,
      paddingHorizontal: 8,
    },
  });
